h z us≈Çug PayPal w Polsce, nie dokona≈Çoby zakupu na zagranicznej stronie, gdyby opcja p≈Çatno≈õci w¬†systemie PayPal nie by≈Ça dostƒôpna.*</span><br style=\"font-family: arial, sans, sans-serif; font-size: 12px; white-space: pre-wrap;\" /><br style=\"font-family: arial, sans, sans-serif; font-size: 12px; white-space: pre-wrap;\" /><span style=\"font-family: arial, sans, sans-serif; font-size: 12px; white-space: pre-wrap;\">Powody sƒÖ proste.</span><br style=\"font-family: arial, sans, sans-serif; font-size: 12px; white-space: pre-wrap;\" /><span style=\"font-family: arial, sans, sans-serif; font-size: 12px; white-space: pre-wrap;\">Dziƒôki renomie PayPal Twoja witryna cieszy siƒô wiƒôkszym zaufaniem klient√≥w zagranicznych. Razem tworzƒÖ oni 193¬†rynki, na kt√≥rych p≈Çaci siƒô w 26¬†r√≥≈ºnych walutach. </span><br style=\"font-family: arial, sans, sans-serif; font-size: 12px; white-space: pre-wrap;\" /><span style=\"font-family: arial, sans, sans-serif; font-size: 12px; white-space: pre-wrap;\">Dodatkowo PayPal jest w stanie zaoferowaƒá Ci obs≈Çugƒô strategii globalnej dziƒôki szerokiemu dostosowaniu do prawa miƒôdzynarodowego. </span><br style=\"font-family: arial, sans, sans-serif; font-size: 12px; white-space: pre-wrap;\" /><br style=\"font-family: arial, sans, sans-serif; font-size: 12px; white-space: pre-wrap;\" /><span style=\"font-family: arial, sans, sans-serif; font-size: 12px; white-space: pre-wrap;\">U≈ºytkownicy systemu PayPal na ca≈Çym ≈õwiecie wiedzƒÖ, ≈ºe system PayPal jest bezpieczniejszy od innych rozwiƒÖza≈Ñ, dziƒôki czemu czujƒÖ siƒô pewniej dokonujƒÖc zakup√≥w na komputerze, urzƒÖdzeniu przeno≈õnym i w ka≈ºdym miejscu, w kt√≥rym akurat siƒô znajdujƒÖ. Spe≈ÇniajƒÖce okre≈õlone warunki zakupy Twoich klient√≥w mogƒÖ byƒá objƒôte programem Ochrony kupujƒÖcych**. Klienci kochajƒÖ wygodƒô, jakƒÖ oferuje PayPal. </span><br style=\"font-family: arial, sans, sans-serif; font-size: 12px; white-space: pre-wrap;\" /><br style=\"font-family: arial, sans, sans-serif; font-size: 12px; white-space: pre-wrap;\" /><span style=\"font-family: arial, sans, sans-serif; font-size: 12px; white-space: pre-wrap;\">* RAPORT O WZRO≈öCIE SPRZEDA≈ªY W EUROPIE W IV KWARTALE 2013, PL</span><br style=\"font-family: arial, sans, sans-serif; font-size: 12px; white-space: pre-wrap;\" /><span style=\"font-family: arial, sans, sans-serif; font-size: 12px; white-space: pre-wrap;\">** https://www.paypal.com/pl/webapps/mpp/paypal-safety-and-security</span></p>					<div class=\"gamification-tip-infobox-content-controls right\">\n						<a href=\"javascript:$.fancybox.close();\" class=\"button\">Annulowaƒá</a>\n						<a href=\"{link}AdminModules{/link}&install=paypal&module_name=paypal\" class=\"button success\">Odkryj modu≈Ç</a>\n					</div>\n				</div>\n			</div>\n		</div>\n	</div>\n</div>\n</div>\n<script>\n	$(document).ready( function () {\n		$(\'.gamification_fancybox\').bind(\'click\', function () {\n			id_advice = 376;\n			popin_url = \'https://gamification.prestashop.com/get_advice_link.php?id_advice=\'+id_advice+\'&url=\';\n			url = window.location.origin+window.location.pathname.replace(\'index.php\', \'\')+$(\'.gamification-tip-infobox-content-controls a.success\').attr(\'href\');\n			$(\'.gamification-tip-infobox-content-controls a.success\').attr(\'href\', popin_url+encodeURIComponent(url));\n			\n			$(\'.gamification-tip-infobox\').after(\'<img style=\"display:none\" src=\"https://gamification.prestashop.com/api/getAdvicePopinImg/\'+id_advice+\'.png\" />\');\n			\n		});\n	});\n</script></div>'),
