(1, 1, 1, 'Dostawa', 'Nasze warunki dostawy', 'conditions, delivery, delay, shipment, pack', '<p dir=\"ltr\" style=\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:13.999999999999998pt;font-family:Arial;color:#000000;background-color:transparent;font-weight:700;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre-wrap;\">DokƒÖd wysy≈Çamy zam√≥wienia?</span></p>\r\n<p dir=\"ltr\" style=\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\"><b style=\"font-weight:normal;\" id=\"docs-internal-guid-edaf886f-7fff-53cb-565a-8edbb6f2bece\"> </b></p>\r\n<p dir=\"ltr\" style=\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre-wrap;\">Zam√≥wienia z≈Ço≈ºone na stronie polskiego sklepu mogƒÖ zostaƒá dostarczone tylko osobom, kt√≥re uko≈Ñczy≈Çy 18 lat i mieszkajƒÖ w Polsce.</span></p>\r\n<p dir=\"ltr\" style=\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre-wrap;\"> </span></p>\r\n<p dir=\"ltr\" style=\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre-wrap;\">Dostawa nastƒôpnego dnia jest dostƒôpna niemal w ca≈Çym kraju. Na etapie finalizacji zam√≥wienia wy≈õwietlane sƒÖ wszystkie opcje dostƒôpne dla danego adresu.</span></p>\r\n<p dir=\"ltr\" style=\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\"><b style=\"font-weight:normal;\"><br /><br /></b></p>\r\n<p dir=\"ltr\" style=\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:13.999999999999998pt;font-family:Arial;color:#000000;background-color:transparent;font-weight:700;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre-wrap;\">Ile trwa dostawa?</span></p>\r\n<p dir=\"ltr\" style=\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\"><b style=\"font-weight:normal;\"> </b></p>\r\n<p dir=\"ltr\" style=\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre-wrap;\">Twoje zam√≥wienie z dostawƒÖ standardowƒÖ powinno zostaƒá dostarczone w ciƒÖgu 3-6 dni roboczych od momentu mailowego potwierdzenia wys≈Çania produkt√≥w.</span></p>\r\n<p dir=\"ltr\" style=\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre-wrap;\"> </span></p>\r\n<p dir=\"ltr\" style=\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre-wrap;\">Aby skorzystaƒá z dostawy nastƒôpnego dnia, musisz z≈Ço≈ºyƒá zam√≥wienie przed 14:30. Dostarczamy paczki w dniach poniedzia≈Çek-piƒÖtek, z wyjƒÖtkiem ≈õwiƒÖt pa≈Ñstwowych. Zam√≥wienie z≈Ço≈ºone w dzie≈Ñ roboczy do 14:30, bƒôdzie dorƒôczone w nastƒôpny dzie≈Ñ roboczy. Zam√≥wienie z≈Ço≈ºone w dzie≈Ñ roboczy po 14:30, bƒôdzie dorƒôczone w ciƒÖgu 2 dni roboczych. Zam√≥wienie z≈Ço≈ºone w piƒÖtek po 14:30 oraz w sobotƒô i niedzielƒô, bƒôdzie dorƒôczone we wtorek.</span></p>\r\n<p dir=\"ltr\" style=\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\"></p>', 'dostawa'),
(2, 1, 1, 'Legal Notice', 'Legal notice', 'notice, legal, credits', '<h2>Legal</h2>\r\n<h3>Credits</h3>\r\n<p>Concept and production:</p>\r\n<p>This Web site was created using <a href=\"http://www.prestashop.com\">PrestaShop</a>‚Ñ¢ open-source software.</p>', 'legal-notice'),
(3, 1, 1, 'Polityka Prywatno≈õci', 'Nasza polityka prywatno≈õci', 'conditions, terms, use, sell', '<h2 dir=\"ltr\" style=\"line-height:1.44;margin-top:0pt;margin-bottom:4pt;background-color:#ffffff;\"><strong><span style=\"font-size:14pt;font-family:Arial;color:#000000;background-color:#ffffff;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre-wrap;\">POLITYKA PRYWATNO≈öCI</span></strong></h2>\r\n<h2 dir=\"ltr\" style=\"line-height:1.44;margin-top:0pt;margin-bottom:4pt;background-color:#ffffff;\"><span style=\"font-size:12pt;font-family:Arial;color:#000000;background-color:#ffffff;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre-wrap;\">Zachowanie poufno≈õci danych jest dla H&amp;M niezwykle wa≈ºne i chcemy, aby ka≈ºdy klient wiedzia≈Ç, w jaki spos√≥b je przetwarzamy. Dlatego sporzƒÖdzili≈õmy Politykƒô prywatno≈õci, kt√≥ra opisuje spos√≥b ochrony i przetwarzania danych osobowych.</span></h2>\r\n<h2 dir=\"ltr\" style=\"line-height:1.44;margin-top:0pt;margin-bottom:4pt;background-color:#ffffff;\">¬†</h2>\r\n<h2 dir=\"ltr\" style=\"line-height:1.44;margin-top:0pt;margin-bottom:4pt;background-color:#ffffff;\"><strong><span style=\"font-size:12pt;font-family:Arial;color:#000000;background-color:#ffffff;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre-wrap;\">Kto kontroluje Twoje dane osobowe?</span></strong></h2>\r\n<h2 dir=\"ltr\" style=\"line-height:1.44;margin-top:0pt;margin-bottom:4pt;background-color:#ffffff;\"><span style=\"font-size:12pt;font-family:Arial;color:#000000;background-color:#ffffff;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre-wrap;\">Przekazywane nam dane osobowe sƒÖ kontrolowane przez szwedzkƒÖ sp√≥≈Çkƒô H &amp; M Hennes &amp; Mauritz GBC AB (‚ÄûH&amp;M‚Äù). Chroni ona tak≈ºe Twoje dane na mocy odpowiedniego prawa o ochronie danych osobowych. </span></h2>\r\n<h2 dir=\"ltr\" style=\"line-height:1.44;margin-top:0pt;margin-bottom:4pt;background-color:#ffffff;\">¬†</h2>\r\n<h2 dir=\"ltr\" style=\"line-height:1.44;margin-top:0pt;margin-bottom:4pt;background-color:#ffffff;\"><span style=\"font-size:12pt;font-family:Arial;color:#000000;background-color:#ffffff;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre-wrap;\">H &amp; M Hennes &amp; Mauritz GBC AB</span></h2>\r\n<h2 dir=\"ltr\" style=\"line-height:1.44;margin-top:0pt;margin-bottom:4pt;background-color:#ffffff;\"><span style=\"font-size:12pt;font-family:Arial;color:#000000;background-color:#ffffff;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre-wrap;\">M√§ster Samuelsgatan 46</span></h2>\r\n<h2 dir=\"ltr\" style=\"line-height:1.44;margin-top:0pt;margin-bottom:4pt;background-color:#ffffff;\"><span style=\"font-size:12pt;font-family:Arial;color:#000000;background-color:#ffffff;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre-wrap;\">106 38 Sztokholm</span></h2>\r\n<h2 dir=\"ltr\" style=\"line-height:1.44;margin-top:0pt;margin-bottom:4pt;background-color:#ffffff;\"><span style=\"font-size:12pt;font-family:Arial;color:#000000;background-color:#ffffff;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre-wrap;\">Szwecja</span></h2>\r\n<h2 dir=\"ltr\" style=\"line-height:1.44;margin-top:0pt;margin-bottom:4pt;background-color:#ffffff;\">¬†</h2>\r\n<h2 dir=\"ltr\" style=\"line-height:1.44;margin-top:0pt;margin-bottom:4pt;background-color:#ffffff;\"><span style=\"font-size:12pt;font-family:Arial;color:#000000;background-color:#ffffff;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre-wrap;\">Rejestr firm: Bolagsverket/Szwedzki UrzƒÖd Rejestracji Przedsiƒôbiorstw</span></h2>\r\n<h2 dir=\"ltr\" style=\"line-height:1.44;margin-top:0pt;margin-bottom:4pt;background-color:#ffffff;\"><span style=\"font-size:12pt;font-family:Arial;color:#000000;background-color:#ffffff;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre-wrap;\">Numer rejestracji firmy: 556070-1715</span></h2>\r\n<h2 dir=\"ltr\" style=\"line-height:1.44;margin-top:0pt;margin-bottom:4pt;background-color:#ffffff;\"><span style=\"font-size:12pt;font-family:Arial;color:#000000;background-color:#ffffff;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre-wrap;\">Autoryzowany przedstawiciel: Karl-Johan Persson</span></h2>\r\n<h2 dir=\"ltr\" style=\"line-height:1.44;margin-top:0pt;margin-bottom:4pt;background-color:#ffffff;\"><span style=\"font-size:12pt;font-family:Arial;color:#000000;background-color:#ffffff;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre-wrap;\">Numer VAT: NR VAT SE556070171501</span></h2>\r\n<h2 dir=\"ltr\" style=\"line-height:1.44;margin-top:0pt;margin-bottom:4pt;background-color:#ffffff;\"><span style=\"font-size:12pt;font-family:Arial;color:#000000;background-color:#ffffff;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre-wrap;\">Gdzie przechowujemy Twoje dane?</span></h2>\r\n<h2 dir=\"ltr\" style=\"line-height:1.44;margin-top:0pt;margin-bottom:4pt;background-color:#ffffff;\"><span style=\"font-size:12pt;font-family:Arial;color:#000000;background-color:#ffffff;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre-wrap;\">Zebrane dane osobowe przechowujemy na terenie Europejskiego Obszaru Gospodarczego (‚ÄûEOG‚Äù), ale mogƒÖ one byƒá tak≈ºe przesy≈Çane do kraju spoza tego obszaru i tam przetwarzane. K