und-color:#ffffff;\">¬†</h2>\r\n<h2 dir=\"ltr\" style=\"line-height:1.44;margin-top:0pt;margin-bottom:4pt;background-color:#ffffff;\"><strong><span style=\"font-size:12pt;font-family:Arial;color:#000000;background-color:#ffffff;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre-wrap;\">Prawo zg≈Çoszenia skargi w organie nadzorczym: ¬†</span></strong></h2>\r\n<h2 dir=\"ltr\" style=\"line-height:1.44;margin-top:0pt;margin-bottom:4pt;background-color:#ffffff;\"><span style=\"font-size:12pt;font-family:Arial;color:#000000;background-color:#ffffff;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre-wrap;\">Je≈õli uwa≈ºasz, ≈ºe H&amp;M przetwarza Twoje dane osobowe w niew≈Ça≈õciwy spos√≥b, mo≈ºesz siƒô z nami skontaktowaƒá. Masz te≈º prawo zg≈Çosiƒá skargƒô w organie nadzorczym.</span></h2>\r\n<h2 dir=\"ltr\" style=\"line-height:1.44;margin-top:0pt;margin-bottom:4pt;background-color:#ffffff;\">¬†</h2>\r\n<h2 dir=\"ltr\" style=\"line-height:1.44;margin-top:0pt;margin-bottom:4pt;background-color:#ffffff;\"><strong><span style=\"font-size:12pt;font-family:Arial;color:#000000;background-color:#ffffff;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre-wrap;\">Uaktualnienia naszych Zasad prywatno≈õci:</span></strong></h2>\r\n<h2></h2>\r\n<h2 dir=\"ltr\" style=\"line-height:1.44;margin-top:0pt;margin-bottom:4pt;border-bottom:solid #dee2e6 .75pt;background-color:#ffffff;\"><span style=\"font-size:12pt;font-family:Arial;color:#000000;background-color:#ffffff;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre-wrap;\">W przysz≈Ço≈õci mo≈ºe zaj≈õƒá konieczno≈õƒá aktualizacji Zasad prywatno≈õci. Ich najnowsza wersja bƒôdzie zawsze dostƒôpna na naszej stronie. Bƒôdziemy informowaƒá o ka≈ºdej zmianie tre≈õci Zasad prywatno≈õci, na przyk≈Çad o zmianach dotyczƒÖcych cel